var indexList={};


class IndexModel {
    constructor() {
        this.model = {
            indexList:{},
            isLoadMore:true
        }
    }

    loadModelData() {
        indexList = indexListData.zhuantiList.slice(0,10);
        this.model.indexList = indexList;
        if(indexList<10){
            this.model.isLoadMore = true;
        }else{
            this.model.isLoadMore = false;
        }
    }

    loadMoreModelData(pageNum) {
        var sliceStartNum = pageNum*10;
        var newLoadList = indexListData.zhuantiList.slice(sliceStartNum,sliceStartNum+10);
        if(newLoadList<10){
            this.model.isLoadMore = true;
        }else{
            this.model.isLoadMore = false;
        }
        indexList = indexList.concat(newLoadList);
        this.model.indexList = indexList;
    }

    getModelData() {
        var obj = new Object();
        obj = this.model;
        return obj;
    }

    getFirstModelData() {
        this.loadModelData();
        var obj = this.getModelData();
        return obj;
    }

    setModelData(pageNum) {
        this.loadMoreModelData(pageNum);
    }
}

module.exports = {
    IndexModel: IndexModel
}

